import React, { useState, useEffect, useRef } from 'react';
import { Outlet, Link } from "react-router-dom";
import styled from 'styled-components';
import Cookies from 'js-cookie';

const Layout = () => {
  const [open, setOpen] = useState(false);
  const [Logout, setLogout] = useState(false);
  const node = useRef();

  useEffect(() => {
    const value = Cookies.get('token');
    setLogout(!value);
  }, []);

  const handleLogout = () => {
    alert('Vous êtes déconnecté');
    document.cookie = "token=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;";
    window.location.href = '/';
  };

  // Fermer le menu burger quand on clique à l'extérieur
  useOnClickOutside(node, () => setOpen(false));

  return (
    <>
      <div ref={node}>
        <Burger open={open} setOpen={setOpen} />
        <Menu open={open} Logout={Logout} handleLogout={handleLogout} />
      </div>
      <Outlet />
    </>
  );
};

// Composants Styled pour le menu burger
const StyledMenu = styled.nav`
  display: flex;
  flex-direction: column;
  justify-content: center;
  background: #EFFFFA;
  transform: ${({ open }) => open ? 'translateX(0)' : 'translateX(-100%)'};
  height: 100vh;
  text-align: left;
  padding: 2rem;
  position: fixed; /* Utilise fixed pour que le menu soit isolé */
  top: 0;
  left: 0;
  transition: transform 0.3s ease-in-out;
  z-index: 999; /* Assure-toi qu'il est au-dessus des autres éléments */
  width: 300px; /* Définit une largeur fixe pour le menu */

  a {
    font-size: 2rem;
    text-transform: uppercase;
    padding: 2rem 0;
    font-weight: bold;
    letter-spacing: 0.5rem;
    color: #0D0C1D;
    text-decoration: none;
    transition: color 0.3s linear;
    
    &:hover {
      color: #343078;
    }
  }
`;

const Menu = ({ open, Logout, handleLogout }) => {
  return (
    <StyledMenu open={open}>
      {Logout ? (
        <>
          <Link to="/">Accueil</Link>
          <Link to="/Inscription">Inscription</Link>
        </>
      ) : (
        <>
          <Link to="/User">User</Link>
          <Link to="/PageAdmin">Page Admin</Link>
          <a className='logout' onClick={handleLogout}>Logout</a>
        </>
      )}
    </StyledMenu>
  );
};

const StyledBurger = styled.button`
  position: absolute; /* Utilise fixed pour le bouton également */
  top: 5%;
  left: 2rem;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  width: 2rem;
  height: 2rem;
  background: transparent;
  border: none;
  cursor: pointer;
  z-index: 1000; /* S'assure que le bouton est toujours cliquable au-dessus des autres éléments */

  &:focus {
    outline: none;
  }

  div {
    width: 2rem;
    height: 0.25rem;
    background: ${({ open }) => open ? '#0D0C1D' : '#EFFFFA'};
    border-radius: 10px;
    transition: all 0.3s linear;
    position: relative;
    transform-origin: 1px;

    :first-child {
      transform: ${({ open }) => open ? 'rotate(45deg)' : 'rotate(0)'};
    }

    :nth-child(2) {
      opacity: ${({ open }) => open ? '0' : '1'};
      transform: ${({ open }) => open ? 'translateX(20px)' : 'translateX(0)'};
    }

    :nth-child(3) {
      transform: ${({ open }) => open ? 'rotate(-45deg)' : 'rotate(0)'};
    }
  }
`;


const Burger = ({ open, setOpen }) => {
  return (
    <StyledBurger open={open} onClick={() => setOpen(!open)}>
      <div />
      <div />
      <div />
    </StyledBurger>
  );
};

// Utilisation d'un hook pour fermer le menu lorsque l'utilisateur clique à l'extérieur
const useOnClickOutside = (ref, handler) => {
  useEffect(() => {
    const listener = event => {
      if (!ref.current || ref.current.contains(event.target)) {
        return;
      }
      handler(event);
    };
    document.addEventListener('mousedown', listener);

    return () => {
      document.removeEventListener('mousedown', listener);
    };
  }, [ref, handler]);
};

export default Layout;
